function logMessage(e,o,g){log(chalk`
   {${g} ${o}}: {red ${e}}
   Time: {green ${(new Date).toString()}}
   `)}const log=console.log,chalk=require("chalk");var appLog={message:function(e){logMessage(e,"Message","blue")},error:function(e){logMessage(e,"Error","red")},info:function(e){logMessage(e,"Info","green")},exception:function(e){logMessage(e,"Exception","white")}};module.exports=appLog;